long_desc.thetext:
This is how we get into believing ASTNode$State doesn't exist:

During full build we do a lookup using

  NameEnvironment#findClass("soot/JastAddJ/ASTNode$State", "ASTNode$State");

When we find the '$' in the name and see that we have additionalUnits, we lookup "soot/JastAddJ/ASTNode" in this.additionalUnits and answer

  return new NameEnvironmentAnswer(unit, null /*no access restriction*/);

But that unit does not contain the expected nested type $State.

